{
    "openapi": "3.0.1",
    "info": {
        "title": "Base dos Dados",
        "description": "**Descrição**\n- Endpoints da Base Dos Dados e do [CKAN](\"https://docs.ckan.org/en/2.9/api/#action-api-reference\")\n\n**Para visualizar uma base:**  \n- Visualize com o **package_show**.\n\n**Para atualizar uma base:**  \n- Realize download dos dados com **package_show**;\n- Atualize manualmente a base (com ponderação);\n- Valide a alteração com **bd_dataset_validate**;\n- Atualize a base com **package_update**.\n",
        "version": "0.1"
    },
    "servers": [{
            "url": "https://basedosdados.org/api/3/action",
            "description": "Servidor de produção"
        },
        {
            "url": "https://staging.basedosdados.org/api/3/action",
            "description": "Servidor de teste"
        },
        {
            "url": "http://localhost/api/3/action",
            "description": "Servidor de desenvolvimento"
        }
    ],
    "paths": {
        "/package_list": {
            "get": {
                "description": "Lista as bases.",
                "responses": {
                    "200": {
                        "description": "",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "type": "object",
                                    "properties": {
                                        "help": {
                                            "type": "string",
                                            "example": "https://basedosdados.org/api/3/action/help_show?name=package_list"
                                        },
                                        "result": {
                                            "type": "array",
                                            "items": {
                                                "type": "string"
                                            }
                                        },
                                        "success": {
                                            "type": "boolean"
                                        }
                                    }
                                }
                            }
                        }
                    }
                },
                "tags": [
                    "CKAN"
                ]
            }
        },
        "/package_show": {
            "get": {
                "description": "Visualiza uma base, com suas organizações, grupos, recursos e tags por seu nome ou ID.",
                "parameters": [{
                    "name": "name_or_id",
                    "in": "query",
                    "schema": {
                        "type": "string"
                    },
                    "example": "br-bd-diretorios-brasil"
                }],
                "responses": {
                    "200": {
                        "description": "OK",
