        "/bd_dataset_search": {
            "get": {
                "description": "Busca bases",
                "parameters": [{
                        "in": "query",
                        "name": "q",
                        "description": "Termo de busca",
                        "schema": {
                            "type": "string"
                        },
                        "example": "agua"
                    },
                    {
                        "in": "query",
                        "name": "page",
                        "description": "Índice da paginação",
                        "schema": {
                            "type": "number"
                        },
                        "example": 1
                    },
                    {
                        "in": "query",
                        "name": "page_size",
